import React from "react";
import Boton from "../utils/ButtonLink";
import exit from "../assets/img/salir.svg";
import mc from "../assets/img/m-c.svg";
import mbreakfast from "../assets/img/02-menu-desayuno.svg";

const MenuBreakfast = () => {
  return (
    <div>
      <Boton image={exit} adress="/" />
      <div>
        <Boton image={mc} adress="/Role" />
      </div>

      <div>
        <Boton image={mbreakfast} adress="/menu-breakfast" />
      </div>

      <div>Aqui se debe mostrar el menu para el desayuno</div>
    </div>/assets
  );
};

export default MenuBreakfast;
